import React, { Component } from 'react'
import { storeProducts } from "./data"

export default class Table extends Component {
    constructor(props) {
        super(props)
        this.state = {
            store: storeProducts.data,

        }
    }


    render() {
        let store = this.state.store;
        // console.log("store :", store);
        var category = {};
        var result = [];
        for (var item, i = 0; item = store[i];i++) {
            let element = item;
            // item["salesperson_name"] = 1;
            if(item[salesperson_name]){
                console.log("item[salesperson_name] ", item.salesperson_name)
            }else{
                item["salesperson_name"] = {};
            }
            result.push(Object.values(element));

        }
        // console.log("Category",Object.keys(category));
        console.log("result :", result);
        return (
            <>
            {/* <table>
